import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import Divider from '@mui/material/Divider';

type DessertDetail = {
  name: string,
  calories: number,
  fat: number,
  carbs: number,
  protein: number
}

type DrawerListProps = {
  data: DessertDetail | null,
  setData: (newData: DessertDetail | null) => void
}

const DrawerMainTable = (props: DrawerListProps) => {
  const { data, setData } = props

  const toggleDrawer = (newData: DessertDetail | null) => () => {
    setData(newData);
  };

  const DrawerList = (
    <Box sx={{ width: 700 }} className="p-8" role="presentation" onClick={toggleDrawer(null)}>
      <h1 className="text-xl font-bold">
        Main drawer 
      </h1>
      <h3 className="text-md font-bold mt-4 mb-2">
        Details: 
      </h3>
      <div className='flex flex-col gap-2 m-2'>
        <div className='text-sm'>
          Dessert: {data?.name}
        </div> 
        <div className='text-sm'>
          Calories: {data?.calories}
        </div>
        <div className='text-sm'>
          Fat (g): {data?.fat}
        </div>
        <div className='text-sm'>
          Carbs (g): {data?.carbs}
        </div>
        <div className='text-sm'>
          Protein (g): {data?.protein}
        </div>
      </div>
      <Divider />
    </Box>
  );

  return (
    <div>
      <Drawer open={data ? true : false} anchor={"right"} onClose={toggleDrawer(null)}>
        {DrawerList}
      </Drawer>
    </div>
  );
}

export default DrawerMainTable
